typedef unsigned long size_t;
typedef unsigned int SERPENT_CBC_VECTOR[16/sizeof(int)];

 typedef struct {
 unsigned int key[140];
 SERPENT_CBC_VECTOR vector;

} SERPENT_CTX, *HSERPENT;






void SerpentKeySetup (HSERPENT hAlgorithm, unsigned char* key);
void SerpentDecrypt (HSERPENT hAlgorithm, unsigned int* In, unsigned int* Out);
void SerpentEncrypt (HSERPENT hAlgorithm, unsigned int* In, unsigned int* Out);



int decrypt(unsigned char *data,size_t len,char *key,char *out) {

  int i=0;
  char *ptr;
  SERPENT_CTX ctx;
  SerpentKeySetup(&ctx,key);
  for(i=0;i<len;i+=16) {
    SerpentDecrypt(&ctx,(unsigned int*)&data[i],(unsigned int*)&out[i]);
  }

}


int encrypt(unsigned char *data,size_t len,char *key,char *out) {

  int i=0;
  char *ptr;
  SERPENT_CTX ctx;
  SerpentKeySetup(&ctx,key);
  for(i=0;i<len;i+=16) {
    SerpentEncrypt(&ctx,(unsigned int*)&data[i],(unsigned int*)&out[i]);
  }
}



